import './App.css';
import NavBar, { ElementsWrapper } from 'react-scrolling-nav';
import HomeIcon from '@material-ui/icons/Home';

const navbarItems = [{
  label: <HomeIcon />,
  target: "item-1"
}, {
  label: "About Me",
  target: "item-2"
}, {
  label: "Languages",
  target: "item-3"
}, {
  label: "Projects",
  target: "item-4"
} ]


function App() {
    return (
        <div>
            <NavBar items={navbarItems} offset={-80} duration={500} delay={0}>
            </NavBar>
            <div className="container">
                <ElementsWrapper items={navbarItems}>
                    <div name="item-1" className="item"></div>

                    <div name="item-2" className="item">

                    </div>

                    <div name="item-3" className="item">

                    </div>

                    <div name="item-4" className="item">

                    </div>

                </ElementsWrapper>
            </div>
        </div>

    );
}


export default App;
